import { Grid } from "@mui/material";
import React from "react";


const Form = () => {
  //Aqui deberan implementar el form completo con sus validaciones

  return (
    <div>
      <form>
        <Grid container
          alignItems={"center"} 
          justifyContent={"space-evenly"}
          spacing={2} 
          sx={{width:"100%"}}
        >
          
        </Grid>
      </form>
    </div>
  );
};

export default Form;
